    letters = [letter.lower() for letter in test.split()]
    # Now we need to count the occurrences of each letter
    occurrences = dict()
    for letter in letters:
        occurrences[letter] = occurrences.get(letter, 0) + 1
    # Now we need to sort the dictionary by the number of occurrences
    occurrences.sort(key=lambda x: x[1])
    # Finally, we need to return the dictionary
    return dict(occurrences)

